"    This topic last updated:",
"   </span>",
"   May 1, 2012.",
"  </div>",
"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H1\">",
"    <span class=\"h1\">",
"     INTRODUCTION",
"    </span>",
"    &nbsp;&mdash;&nbsp;Nonsteroidal antiinflammatory drugs (NSAIDs) have a variety of adverse effects. From a cardiovascular viewpoint, they can both raise the blood pressure and affect overall cardiovascular risk.",
"   </p>",
"   <p>",
"    The effect of NSAIDs and",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?15/27/15802?source=see_link\">",
"     acetaminophen",
"    </a>",
"    on the blood pressure and the development of hypertension will be reviewed here. The cardiovascular effects of NSAIDs are discussed separately. (See",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?24/4/24648?source=see_link\">",
"     \"Nonselective NSAIDs: Adverse cardiovascular effects\"",
"    </a>",
"    and",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?38/27/39351?source=see_link\">",
"     \"COX-2 selective inhibitors: Adverse cardiovascular effects\"",
"    </a>",
"    .)",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H2\">",
"    <span class=\"h1\">",
"     NSAIDS AND BLOOD PRESSURE",
"    </span>",
"    &nbsp;&mdash;&nbsp;All nonsteroidal antiinflammatory drugs (NSAIDs) in doses adequate to reduce inflammation and pain can increase blood pressure in both normotensive and hypertensive individuals [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/1\">",
"     1",
"    </a>",
"    ]. The average rise in blood pressure is",
"    <span class=\"nowrap\">",
"     3/2",
"    </span>",
"    mmHg but varies considerably [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/2-4\">",
"     2-4",
"    </a>",
"    ]. In addition, NSAID use may reduce the effect of all antihypertensive drugs except calcium channel blockers [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/5\">",
"     5",
"    </a>",
"    ]. These effects may contribute to the increase in cardiovascular risk associated with the selective COX-2 inhibitors [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/6\">",
"     6",
"    </a>",
"    ]. (See",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?38/27/39351?source=see_link\">",
"     \"COX-2 selective inhibitors: Adverse cardiovascular effects\"",
"    </a>",
"    .)",
"   </p>",
"   <p>",
"    The prohypertensive effect is dose-dependent and probably involves inhibition of cyclooxygenase-2 (COX-2) in the kidneys, which reduces sodium excretion and increases intravascular volume [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/5\">",
"     5",
"    </a>",
"    ]. Low dose",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?24/7/24698?source=see_link\">",
"     aspirin",
"    </a>",
"    has no COX-2-inhibiting or prohypertensive effects. As an example, 75",
"    <span class=\"nowrap\">",
"     mg/day",
"    </span>",
"    of aspirin did not interfere with antihypertensive therapy, as compared with placebo, in 18,790 patients in the Hypertension Optimal Treatment (HOT) Study [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/7\">",
"     7",
"    </a>",
"    ]. However, these conclusions cannot be extended to larger doses of aspirin.",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H3\">",
"    <span class=\"h1\">",
"     ACETAMINOPHEN AND BLOOD PRESSURE",
"    </span>",
"    &nbsp;&mdash;&nbsp;",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?15/27/15802?source=see_link\">",
"     Acetaminophen",
"    </a>",
"    produces its analgesic effect by inhibiting the same cyclooxygenase, prostaglandin H2 synthase, that is the target of NSAID and",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?24/7/24698?source=see_link\">",
"     aspirin",
"    </a>",
"    [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/8\">",
"     8",
"    </a>",
"    ]. However, acetaminophen blocks this enzyme at its peroxidase catalytic rather than at the cyclooxygenase catalytic site. Therefore, the acetaminophen-mediated inhibition is sensitive to changes in the tissue peroxide levels; higher concentrations of peroxide in activated leukocytes and platelets block the effect of acetaminophen on inflammation and platelet thrombosis. However, acetaminophen is able to inhibit prostaglandins in the central nervous system, thus providing relief of pain and fever. Therefore, acetaminophen is not an NSAID or anti-thrombotic agent.",
"   </p>",
"   <p>",
"    Some [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/9-13\">",
"     9-13",
"    </a>",
"    ] but not all [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/14\">",
"     14",
"    </a>",
"    ] studies have shown an increase in blood pressure and cardiovascular events with",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?15/27/15802?source=see_link\">",
"     acetaminophen",
"    </a>",
"    . In one two-week randomized crossover trial in 33 patients with coronary artery disease, acetaminophen (1 g three times daily) but not placebo increased systolic and diastolic blood pressure as determined by ambulatory monitoring from 122 to 125 mmHg systolic and from 73 to 75 mmHg diastolic; however, measures of endothelial and platelet function did not change [",
"    <a class=\"abstract\" href=\"mobipreview.htm?41/43/42674/abstract/13\">",
"     13",
"    </a>",
"    ].",
"   </p>",
"   <p>",
"    There are inconclusive data of an increased cardiovascular risk from regular use of",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?15/27/15802?source=see_link\">",
"     acetaminophen",
"    </a>",
"    in usual doses that are widely used for pain relief.",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H4\">",
"    <span class=\"h1\">",
"     SUMMARY",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      All NSAIDs may raise blood pressure and diminish the antihypertensive efficacy of all classes of antihypertensive drugs, except calcium channel blockers. (NSAIDs and blood pressure\" above).",
"     </li>",
"     <li>",
"      <a class=\"drug drug_general\" href=\"mobipreview.htm?24/7/24698?source=see_link\">",
"       Aspirin",
"      </a>",
"      , in the low dose that is used as an antithrombotic agent, does not affect blood pressure or interfere with the efficacy of antihypertensive drugs. (See",
"      <a class=\"local\" href=\"#H2\">",
"       'NSAIDs and blood pressure'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      <a class=\"drug drug_general\" href=\"mobipreview.htm?15/27/15802?source=see_link\">",
"       Acetaminophen",
"      </a>",
"      may raise blood pressure even at doses commonly used for pain relief. (See",
"      <a class=\"local\" href=\"#H3\">",
"       'Acetaminophen and blood pressure'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
"  </div>",
