var title_f41_43_42683="Diagnostic criteria for MDS-MPN unclassifiable";
var content_f41_43_42683=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F85789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F85789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for myelodysplastic/myeloproliferative neoplasm, unclassifiable (MDS/MPN, U)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        The case has clinical, laboratory, and morphological features of one of the categories of MDS (refractory cytopenia with unilineage dysplasia, refractory anemia with ring sideroblasts, refractory cytopenia with multilineage dysplasia, refractory anemia with excess of blasts) and &lt;20 percent blasts in the blood and bone marrow",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         And",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <p>",
"         Has prominent myeloproliferative features, eg platelet count &ge;450x10",
"         <sup>",
"          9",
"         </sup>",
"         /L associated with megakaryocytic proliferation, or WBC count &ge;13x10",
"         <sup>",
"          9",
"         </sup>",
"         /L, with or without prominent splenomegaly and has no preceding history of an underlying MPN or of MDS, no history of recent cytotoxic or growth factor therapy that could explain the myelodysplastic or myeloproliferative features, and no Philadelphia chromosome or",
"         <em>",
"          BCR-ABL1",
"         </em>",
"         fusion gene, no rearrangement of",
"         <em>",
"          PDGFRA, PDGFRB, FGFR1,",
"         </em>",
"         and no isolated del(5q), t(3;3)(q21;q26) or inv(3)(q21q26)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        The patient has",
"        <em>",
"         de novo",
"        </em>",
"        disease with mixed myeloproliferative and myelodysplastic features and cannot be assigned to any other category of MDS, MPN, or of MDS/MPN",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MDS: myelodysplastic syndrome; MPN: myeloproliferative neoplasm",
"    </div>",
"    <div class=\"reference\">",
"     From Swerdlow SH, Campo E, Harris NL, Jaffe ES, Pileri SA, Stein H, Thiele J, Vardiman JW. World Health Organization Classification of Tumours of Haematopoietic and Lymphoid Tissues. IARC, Lyon, 2008. Reproduced with permission. Copyright &copy; 2008 IARC.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
