var title_f41_43_42684="Serotonin modulator antidepressants - Pharmacokinetics";
var content_f41_43_42684=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F88062&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F88062&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Serotonin modulator antidepressants: Pharmacokinetics",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"8\" width=\"12%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Bioavailability",
"        <br/>",
"        (percent)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Time to peak plasma concentration",
"        <br/>",
"        (hours)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Primary metabolism*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Active metabolite(s)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Elimination half-life",
"        <br/>",
"        (hours)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect(s) on drug metabolism",
"        <br/>",
"        (significant)*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clearance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"8\">",
"        Trazodone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Immediate release",
"       </td>",
"       <td>",
"        65",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         1 (unfed)",
"        </p>",
"        <p>",
"         2 (fed)",
"        </p>",
"        9 (unfed)",
"       </td>",
"       <td rowspan=\"2\">",
"        CYP3A4",
"       </td>",
"       <td rowspan=\"2\">",
"        Yes",
"        <br/>",
"        (",
"        <em>",
"         m",
"        </em>",
"        -chlorophenylpiperazine)",
"       </td>",
"       <td>",
"        5 to 9",
"       </td>",
"       <td rowspan=\"2\">",
"        P-gp inducer",
"       </td>",
"       <td rowspan=\"2\">",
"        Hepatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Extended release",
"       </td>",
"       <td>",
"        87 (preferably taken on empty stomach)",
"       </td>",
"       <td>",
"        10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vilazodone",
"       </td>",
"       <td>",
"        72 (preferably taken with meal)",
"       </td>",
"       <td>",
"        4 to 5",
"       </td>",
"       <td>",
"        CYP3A4; dose alteration needed with strong or moderate inhibitors of CYP3A4",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        25",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        Hepatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nefazodone",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        20 (modestly decreased by food)",
"       </td>",
"       <td>",
"        0.5 to 2 (delayed by food)",
"       </td>",
"       <td>",
"        <p>",
"         CYP3A4",
"        </p>",
"        CYP2D6",
"       </td>",
"       <td>",
"        Yes",
"        <br/>",
"        (Triazoledione, hydroxynefazodone, and",
"        <em>",
"         m",
"        </em>",
"        -chlorophenylpiperazine [mCPP])",
"       </td>",
"       <td>",
"        <p>",
"         2-5 (parent)",
"        </p>",
"        2-33 (active metabolites)",
"       </td>",
"       <td>",
"        Potent inhibitor of CYP 3A4 and P-gp inducer; can cause numerous dose-dependent drug interactions",
"       </td>",
"       <td>",
"        Hepatic; avoid in hepatic disease or in setting of elevated transaminases (complicates monitoring); half-life and serum concentrations increased in hepatic insufficiency",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CYP: cytochrome P450; Pgp: P-glycoprotein efflux transporter.",
"     <br/>",
"     * Drug interactions and management suggestions may be determined by use of Lexi-Interact, the drug interactions program included with UpToDate.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Not a first or second line choice. Rare reports of fatal hepatotoxicity lead to market withdrawal in many countries.",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Spina E, Trifir&ograve; G, Caraci F. Clinically significant drug interactions with newer antidepressants. CNS Drugs 2012; 26:39.",
"      </li>",
"      <li>",
"       Frampton JE. Vilazodone: in major depressive disorder. CNS Drugs 2011; 25:615.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
